import React from 'react';
import ReactDOM from 'react-dom';
import FormSignup from './FormSignup'
import './Form.css'
import FormSignIn from './FormSignIn'

class Form extends React.Component {
  render() {
    return (
      <div className='sign container-fluid'>
        <FormSignIn />
        <FormSignup />
      </div>
    );
  }
}

export default Form;
